from typing import List
from collections import defaultdict

class Trie:
    def __init__(self,is_end=False):
        # self.val = val
        self.is_end = is_end
        self.childs = [None]*26

class Solution:
    def maxRectangle(self, words: List[str]) -> List[str]:
        if not words:
            return words
        max_length = 0
        root = Trie()
        words_map = defaultdict(set)
        # 1、构建字典树
        for word in words:
            cur = root
            for i in word:
                index = ord(i)-ord('a')
                if cur.childs[index] is None:
                    cur.childs[index]=Trie()
                cur = cur.childs[index]
            cur.is_end = True
            max_length = max(max_length,len(word))
            words_map[len(word)].add(word)

        self.max_size = 0
        wordLengths = sorted(words_map.keys(), reverse=True)
        for key in wordLengths:
            path = []
            word_list = words_map.get(key)
            if len(word_list) * key <= self.max_size:
                continue
            nodes = [root]*key
            self.dfs(word_list,nodes,path,max_length,key)
            # 减枝
            if self.max_size>=max_length*max_length:
                break
        return self.max_res

    def dfs(self,word_list,nodes,path,max_length,word_size):
        # 减枝
        if len(path)>max_length:
            return
        for word in word_list:
            if all(nodes[i].childs[ord(word[i])-ord('a')] is not None for i in range(word_size)):
                path.append(word)
                next_nodes = [nodes[i].childs[ord(word[i])-ord('a')] for i in range(word_size)]
                if all(next_nodes[i].is_end for i in range(word_size)) and len(path)*len(path[0])>self.max_size:
                    self.max_res = path[:]
                    self.max_size = len(path)*len(path[0])
                self.dfs(word_list,next_nodes,path,max_length,word_size)
                path.pop()
        return

    def is_vaild(self,path,root):
        """
        1、判断path是否合适
        2、判断在列维度是否已经结束
        :param path:
        :param words_set:
        :param words_dic:
        :return:
        """
        word_length = len(path[0])
        row = len(path)
        is_vaild=True
        is_end = True
        for i in range(word_length):
            cur = root
            # 这里两层for循环会超时，比较好的方法就是复用前缀树结构，每次只关心新添加一层的数据
            for j in range(row):
                index = ord(path[j][i])-ord('a')
                if cur.childs[index] is None:
                    is_vaild = False
                    is_end = False
                    break
                cur = cur.childs[index]
            if not cur.is_end:
                is_end = False
        return is_vaild, is_end


class Trie2:
    def __init__(self):
        self.children = dict()
        self.isEnd = False
        self.word = None

    def insert(self, word):
        node = self
        for ch in word:
            if ch not in node.children:
                node.children[ch] = Trie2()
            node = node.children[ch]
        node.isEnd = True
        node.word = word


class Solution2:
    def maxRectangle(self, words: List[str]) -> List[str]:
        wordsByLen = defaultdict(list)
        for word in words:
            wordsByLen[len(word)].append(word)
        wordLengths = sorted(wordsByLen.keys(), reverse=True)

        trie = Trie2()
        for word in words:
            trie.insert(word)

        def backtrack(nodes, path, depth):
            nonlocal maxArea
            wordLen = len(nodes)
            if wordLen * depth > maxArea and all(node.isEnd for node in nodes):
                maxArea = wordLen * depth
                ans[:] = path[:]

            for word in wordsByLen[wordLen]:
                if all(word[i] in nodes[i].children for i in range(wordLen)):
                    nxtNodes = [nodes[i].children[word[i]] for i in range(wordLen)]
                    path.append(word)
                    backtrack(nxtNodes, path, depth + 1)
                    path.pop()

        maxArea = 0
        ans = []
        for wordLen in wordLengths:
            nodes = [trie] * wordLen
            backtrack(nodes, [], 0)
            if maxArea >= wordLen * wordLen:
                break
        return ans

